warp:
shader_body
{
    // sample previous frame
    ret =texture( sampler_main, uv ).xyz;
    ret += texture(sampler_blur2, uv).xyz*0.1;
    ret /= 1.1;

    // darken over time
    ret -= 0.02;//*= 0.95; //or try: ret -= 0.004;
}

comp:
shader_body
{
    ret =texture(sampler_main, uv).xyz*1 +
              ((texture(sampler_blur1, uv).xyz * scale1) + bias1)*3 +
              ((texture(sampler_blur2, uv).xyz * scale2) + bias2)*0 +
              ((texture(sampler_blur3, uv).xyz * scale3) + bias3)*0 +
              0;
    ret += ((texture(sampler_blur2,  (uv-0.5)*0.333 + 0.5).xyz * scale2) + bias2);
    ret *= 1;
}

warp_hlsl:
shader_body
{
    // sample previous frame
    ret = tex2D( sampler_main, uv ).xyz;
    ret += tex2D(sampler_blur2, uv).xyz*0.1;
    ret /= 1.1;

    // darken over time
    ret -= 0.02;//*= 0.95; //or try: ret -= 0.004;
}

comp_hlsl:
shader_body
{
    ret = tex2D(sampler_main, uv).xyz*1 +
              GetBlur1(uv)*3 +
              GetBlur2(uv)*0 +
              GetBlur3(uv)*0 +
              0;
    ret += GetBlur2( (uv-0.5)*0.333 + 0.5);
    ret *= 1;
}
